// Death Nova
<Custom Apply Effect>
// Get the Death Nova state's ID
var deathNovaId = 63;
// Check if the target is dead and is affected by the Death Nova state
if (target.isDead() && target.isStateAffected(deathNovaId)) {
  // Get the poison state
  var poisonId = 64;
  // Get the original caster for the Death Nova state
  var caster = target.stateOrigin(deathNovaId);
  // Calculate the damage dealt
  var dmg = caster.mat * 6;
  // Get the dying unit's opponents
  var foes = target.opponentsUnit().aliveMembers();
  // Loop through the foes
  for (var i = 0; i < foes.length; ++i) {
    // Get the currently looped foe
    var foe = foes[i];
    // Check if the foe exists
    if (foe) {
      // Make the foe take damage.
      foe.gainHp(-dmg);
      // Add the poison state to the foe.
      foe.addState(poisonId);
      // Show the damage popup.
      foe.startDamagePopup();
      // Check if the foe is dead
      if (foe.isDead()) {
        // If it is, collapse the foe
        foe.performCollapse();
      }
      // Clear the foe's results
      foe.clearResult();
    }
  }
  // Play an animation on the dying unit
  target.startAnimation(109);
  // Remove the Death Nova state
  target.removeState(deathNovaId);
}
</Custom Apply Effect>

//Passive State for Boss Enemy

<Custom Passive Condition>
// The passive effect will only be true if there's more than 1 member on the field
condition = user.friendsUnit().aliveMembers().length > 1;
</Custom Passive Condition>

<Custom React Effect>
// Check if this dealt HP damage
if (this.isHpEffect() && value > 0) {
  // Get the current group of alive allies
  var allies = target.friendsUnit().aliveMembers();
  // Calculate the amount of damage dealt spread across the allies
  var dmg = Math.ceil(value / Math.max(1, allies.length - 1));
  // Check if the number of allies is greater than 0
  if (allies.length - 1 > 0) {
    // If it is, reduce the direct damage to 0
    value = 0;
  }
  // Loop through each of the allies
  for (var i = 0; i < allies.length; ++i) {
    // Get the currently looped ally
    var ally = allies[i];
    // Check if the ally exists and isn't the target
    if (ally && ally !== target) {
      // Make the ally take damage
      ally.gainHp(-dmg);
      // Show the damage popup
      ally.startDamagePopup();
      // Display an animation on that ally
      ally.startAnimation(12);
      // If the ally is dead
      if (ally.isDead()) {
        // Then make the ally collapse
        ally.performCollapse();
      }
      // Clear the ally's results
      ally.clearResult();
    }
  }
}
</Custom React Effect>
